import React from 'react';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

export default function Home() {
  return (
    <div className='home'>
      <Container maxWidth='xl'>
        <Box sx={{display:'flex',justifyContent:'center'}}>
        <Box align='center'>
          <img src='https://img.freepik.com/free-vector/isometric-laptop-with-shopping-cart-keypad_1262-16544.jpg?w=900&t=st=1707025145~exp=1707025745~hmac=9449df8e88a38db1499338a3d30903bde219eabe02dc535ef3b447ea9b98764b' height='600px' width='600px'/>
        </Box>
        <Box>
          <Typography variant='h2' align='center'>Welcome</Typography>
        </Box>
        </Box>
      </Container>
    </div>
  )
}
